import "./IconLogin.css"


const IconLogin = ({imagen, text}) => {

    return (
        <div id="logIn">
            <div id="iconPhone">
                <img src={imagen} alt="Icon Telephone" id="phone" />
                <p>{text}</p>
            </div>




        </div>
    )
}

export default IconLogin
